import {Link} from 'react-router-dom';

export default function Home() {
    return (
        <div className="Home">
            HOME
            <div className="Header">
                <div className="flex-title">
                    <img src={Logo} alt="logo" width='120px' height='160px' padding = '0' />
                </div>
                <Link to="/login"></Link>
            </div>
        </div>
    )
}
